import React from 'react'
import {Grid,Paper,Avatar, TextField} from '@mui/material'
import LockOutlinedIcon from '@mui/icons-material/LockOutlined'
const Login = ()=>{
    const paperStyle={padding:20,height:'70vh',width:400,margin:'20px auto'}
    const avatarStyle={backgroundColor:'green',}
    return(
        <Grid>
            <Paper elevation={10} style={paperStyle}>
                <Grid align='center'>
                    <Avatar style={avatarStyle}><LockOutlinedIcon></LockOutlinedIcon></Avatar>
                    <h2>Logar</h2>
                </Grid>
                <TextField label='Email' placeholder='Email' fullWidth></TextField>
                <TextField label='Senha' placeholder='Senha' fullWidth></TextField>
            </Paper>
        </Grid>
    )
}

export default Login
